n = 1
def plot_loss_history(Encodings, datasets):
    for Encoding in Encodings:

        if Encoding == 'PCA8':
            if datasets == 'MNIST':
                loss_history_QCNN_mean = loss_history_QCNN_pca8_MNIST_mean[::n]
                loss_history_QCNN_std = loss_history_QCNN_pca8_MNIST_std[::n]
                loss_history_CNN_mean = loss_history_CNN_pca8_MNIST_mean[::n]
                loss_history_CNN_std = loss_history_CNN_pca8_MNIST_std[::n]
            else:
                loss_history_QCNN_mean = loss_history_QCNN_pca8_FASHION_mean[::n]
                loss_history_QCNN_std = loss_history_QCNN_pca8_FASHION_std[::n]
                loss_history_CNN_mean = loss_history_CNN_pca8_FASHION_mean[::n]
                loss_history_CNN_std = loss_history_CNN_pca8_FASHION_std[::n]

        elif Encoding == 'PCA16':
            if datasets == 'MNIST':
                loss_history_QCNN_mean = loss_history_QCNN_pca16_MNIST_mean[::n]
                loss_history_QCNN_std = loss_history_QCNN_pca16_MNIST_std[::n]
                loss_history_CNN_mean = loss_history_CNN_pca16_MNIST_mean[::n]
                loss_history_CNN_std = loss_history_CNN_pca16_MNIST_std[::n]
            else:
                loss_history_QCNN_mean = loss_history_QCNN_pca16_FASHION_mean[::n]
                loss_history_QCNN_std = loss_history_QCNN_pca16_FASHION_std[::n]
                loss_history_CNN_mean = loss_history_CNN_pca16_FASHION_mean[::n]
                loss_history_CNN_std = loss_history_CNN_pca16_FASHION_std[::n]

        elif Encoding == 'AutoEnc8':
            if datasets == 'MNIST':
                loss_history_QCNN_mean = loss_history_QCNN_ae8_MNIST_mean[::n]
                loss_history_QCNN_std = loss_history_QCNN_ae8_MNIST_std[::n]
                loss_history_CNN_mean = loss_history_CNN_ae8_MNIST_mean[::n]
                loss_history_CNN_std = loss_history_CNN_ae8_MNIST_std[::n]
            else:
                loss_history_QCNN_mean = loss_history_QCNN_ae8_FASHION_mean[::n]
                loss_history_QCNN_std = loss_history_QCNN_ae8_FASHION_std[::n]
                loss_history_CNN_mean = loss_history_CNN_ae8_FASHION_mean[::n]
                loss_history_CNN_std = loss_history_CNN_ae8_FASHION_std[::n]

        elif Encoding == 'AutoEnc16':
            if datasets == 'MNIST':
                loss_history_QCNN_mean = loss_history_QCNN_ae16_MNIST_mean[::n]
                loss_history_QCNN_std = loss_history_QCNN_ae16_MNIST_std[::n]
                loss_history_CNN_mean = loss_history_CNN_ae16_MNIST_mean[::n]
                loss_history_CNN_std = loss_history_CNN_ae16_MNIST_std[::n]
            else:
                loss_history_QCNN_mean = loss_history_QCNN_ae16_FASHION_mean[::n]
                loss_history_QCNN_std = loss_history_QCNN_ae16_FASHION_std[::n]
                loss_history_CNN_mean = loss_history_CNN_ae16_FASHION_mean[::n]
                loss_history_CNN_std = loss_history_CNN_ae16_FASHION_std[::n]

        x = np.linspace(0, 200, 200)
        low_QCNN = loss_history_QCNN_mean - loss_history_QCNN_std
        high_QCNN = loss_history_QCNN_mean + loss_history_QCNN_std

        plt.plot(x, loss_history_QCNN_mean[0], 'k', color='#CC4F1B')
        plt.fill_between(x, low_QCNN[0], high_QCNN[0],
                        alpha=0.5, edgecolor='#CC4F1B', facecolor='#FF9848', linewidth=1)

        low_CNN = loss_history_CNN_mean - loss_history_CNN_std
        high_CNN = loss_history_CNN_mean + loss_history_CNN_std
        plt.plot(x, loss_history_CNN_mean[0], 'k', color='#1B2ACC')
        plt.fill_between(x, low_CNN[0], high_CNN[0],
                        alpha=0.5, edgecolor='#1B2ACC', facecolor='#089FFF',
                        linewidth=1)
        plt.title('QCNN vs CNN  with ' + str(Encoding) + ' for ' + datasets)
        plt.ylabel('Loss', fontsize='15')
        plt.xlabel('Iterations', fontsize='15')
        plt.xticks(fontsize=15)
        plt.yticks(fontsize=15)
        plt.rc('xtick', labelsize=15)
        plt.rc('ytick', labelsize=12)
        plt.legend(['QCNN', 'CNN'], loc='upper left')
        plt.show()


